 in Austria. May be an image of one or more people, people standing and indoor.","edge_media_to_caption":{"edges":[{"node":{"text":"I am very happy to announce that my recovery is going well. The MRI I did today showed that my wrist injury has improved significantly. A couple of weeks ago I started playing with soft balls and was able to switch to normal tennis balls during yesterday's practise session. My team and I strongly believe that I\u2019ll be ready to make my comeback to competition later this year. \n\nI\u2019ll be returning to competition in December and will be playing the MWTC 2021 in Abu Dhabi - with the objective to return to the tour for the 2022 Australian Open. Needless to say that the vaccine is needed to play both events, and in my case I have already been vaccinated. I saw recently some news about this and I had made it very clear that I would get vaccinated. Hopefully the next time things won\u2019t be taken this far as I saw last week\u2026\n\nLast but not least, I would like to thank all of my fans who have been incredibly supportive these last couple of months and I cannot wait to play my first competitive match in a little over a month."}}]},"edge_media_to_comment":{"count":1433},"comments_disabled":false,"taken_at_timestamp":1635872611,"edge_liked_by":{"count":82419},"edge_media_preview_like":{"count":82419},"location":{"id":"262309028","has_public_page":true,"name":"Austria","slug":"austria"},"thumbnail_src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/251692527_1988437004663892_8603864787313092562_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=9We62VchqqkAX8MnhhB\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=9ff5ad46f720bbfff84e90d36f5a32f2\u0026oe=6192FA55\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s150x150/251692527_1988437004663892_8603864787313092562_n.jpg?_nc_ht=instagram.fudi2
